import React from "react";
import Form from "./components/Form";
import Section from "./components/Section";
import List from "./components/List"
const appTitle = "To-Do List"
const App = () => {
    return <div className="ui container center aligned">
        <Section>
            <h1>{appTitle}</h1>
        </Section>
        <Section>
            <Form />
        </Section>

        <Section>
            <List />
        </Section>
    </div>;
};

export default App;
